import { ConsoleDebug } from "./Server-Client-Shared/Dev/Debug"
import { Get_All_Setting } from "./Socket/SettingSocket"
import { Force_Logout, Start_With_Token } from "./Socket/UserSocket"
import { GridBtn, GridDebug } from "./devComponent"
import {useStore,useEffectV2,useSelector,Guest,memo,UserClient,socket,Game} from "./importAll"

const App = memo(()=>{
    let {actions,dispatch}  = useStore()
    let allStore = useSelector<any,any>(store=>store)

    let mainPage            = useSelector<any,any>(store=>store.mainPage)
  

    useEffectV2("app",()=>{
        Start_With_Token({actions,dispatch});
        Force_Logout({actions,dispatch});
        Get_All_Setting({actions,dispatch})
    })
 
    return(
    <>
        {mainPage=="Guest"?<Guest/> :"" }
        {mainPage=="Game" ?<Game/> :"" }
        <ConsoleDebug allStore={allStore}/>
        <GridDebug />
    </>
    )

})



export default App
